import React from "react";

function App() {
  const [dados, setDados] = React.useState(null);

  React.useEffect(() => {
    async function teste() {
      const response =
        await "https://ranekapi.origamid.dev/json/api/produto/notebook";
      const json = await response.json();
      setDados(json);
    }
  });

  return <div></div>;
}

export default App;
